import { useParams } from 'react-router-dom';
import Usefetch from './Usefetch';
// import { useNavigate } from "react-router-dom";
import { Link } from 'react-router-dom';

const Detailes = () => {

    const { id } = useParams();
    // const navigate = useNavigate();
    const { data: medical, isloading, error } = Usefetch('http://localhost:8000/Medical/' + id);
    const { data: Booking, isloading2, error2 } = Usefetch('http://localhost:8000/booking/' + id);


    return (

        <div className="detalesinf">


            {error && <div>{error}</div>}
            {isloading && <div className="loading">LOADING.....</div>}
            {medical && <div className='detales'>

                <div key={medical.id}>
                    <label><h2>Information Doctor:</h2></label>
                    <h5>Name DR:{medical.Drname}</h5>
                    <h5>Experience:{medical.Experience}</h5>
                    <h5>Phone:{medical.phone}</h5>
                    <h5>Emaile:{medical.emile}</h5>
                    <button type="button" className="btn btn-success"><Link className='creat' to="/Createbooking">Creat a Booking </Link></button>

                </div>


            </div>}

            <div className='data-booking'>

                {error2 && <div>{error2}</div>}
                {isloading2 && <div className="loading">LOADING.....</div>}

                {Booking && <div className='detales'>

                    <div key={Booking.id}>
                        <label><h2>Information Doctor:</h2></label>
                        <h5>FirstName:{Booking.firstname}</h5>
                        <h5>LastName:{Booking.lastname}</h5>
                        <h5>Case:{Booking.Case}</h5>
                        <h5>Payment:{Booking.Payment}</h5>
                        <h5>Date:{Booking.date}</h5>
                        <h5>Time:{Booking.time}</h5>



                    </div>
                </div>}





            </div>

        </div>





    );
}
export default Detailes;
